import React from 'react';
import styled from 'styled-components';
import Logo from './Logo.js';
import Searchbar from './Searchbar';
import NavButton from './NavButton';
import NowLogout from './NowLogout.js';

const HeaderS = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  display: flex;

  width:100%;
  min-width: 1920px;
  height: 60px;
  padding: 1rem;
  font-weight: bold;
  display: flex;
  align-items: center;
  background-color: white;
  border-top: 3px solid black;
  border-bottom: 3px solid black;
`;

function Header({ children }) {

  return <HeaderS>
    <Logo>Digital Store</Logo>
    <Searchbar></Searchbar>
    <NavButton style="marginLeft:-10px">New</NavButton>
    <NavButton>Best</NavButton>
    <NavButton>Sale</NavButton>
    <NowLogout>로그인</NowLogout>
    <NowLogout>회원가입</NowLogout>
  </HeaderS>;
}

export default Header;
